INSERT INTO `wp_ee_schools` (`id`, `name`, `description`, `logo`, `stype`, `zipcode`, `trashed`) VALUES
(1, 'Ivy Bridge College', '<p><strong>Guided Path. Brighter Future.</strong><br /><br />Ivy Bridge College’s associate degree programs provide the flexibility and convenience of online learning while offering unparalleled mentoring and student support. You’ll learn from expert faculty and benefit from a dedicated success coach who will guide you from admission through graduation and beyond. Courses are available online anytime from anywhere—giving you the freedom to set your own schedule.<br /><br />And if you want to pursue a four-year degree, Ivy Bridge provides streamlined admission to some of the best four-year colleges in the U.S.<br /><br />Ivy Bridge College offers online associate degree programs. They are designed for maximum transferability and to reflect your diverse academic needs and professional ambitions.<br /><br />Ivy Bridge College is part of Tiffin University, an accredited independent institution that has been educating students since 1888. The sooner you begin your degree program at Ivy Bridge, the closer you will be to graduation and the future you deserve.</p>', 'http://www.mycollegelocator.com/wp-content/uploads/2013/04/ivy3.jpg', 'online', '1', 0),
(2, 'Salem International University Online', 'Earning your degree at Salem International University Online gives you the opportunity to change your life for the better and gives you more career choices than you have ever dreamed about.\r\n<br><br>\r\nSalem International University Online makes getting an education more convenient than ever. In less time than traditional programs, you could be on your way to fulfilling your long-awaited career goals.\r\n<br><br>\r\nDegrees offered at Salem International University Online:\r\n<ul>\r\n<li>Business Administration (AS)</li>\r\n<li>Business Administration (BS)</li>\r\n<li>Accounting</li>\r\n<li>International Business\r\nManagement</li>\r\n<li>Sports Management</li>\r\n<li>Information Technology (BS)</li>\r\n<li>Criminal Justice: CSI (BS)</li>\r\n<li>RN to BSN Degree Completion</li>\r\n<li>Master of Business Administration (MBA)</li>\r\n</ul>\r\nWhen you choose Salem International University Online, you open more doors. Our online program is perfect for any student who wants to start a new career or professional who wants to advance in their career.\r\n<br><br>\r\nAfter completing your degree at Salem International University Online, you\\''ll have marketable, professional skills and the ability to make decisions with integrity and a business-minded perspective.\r\n<br><br>\r\nSalem International University Online\\''s virtual classrooms provide an enhanced learning environment. We bring the classroom to you so you can earn your degree without leaving behind your home, family or job. So fill out the information form and take the first step toward your new and rewarding future!\r\n<br><br><i>Salem International University is a private, for-profit institution of higher learning that is accredited by The Higher Learning Commission of the North Central Association (http://www.ncahlc.org); and the West Virginia State Board of Education.</i>\r\n<br><br>** Please contact admissions for accreditation and financial aid information.\r\nFor more information about our graduation rates, the median debt of students who completed the program and other important information, please \r\n<a title=\\"Program Disclosures\\" data-lyte-options=\\"width:950 height:600 scrollbars:yes\\" class=\\"lytebox\\" href=\\"www.salemu.edu/disclosures\\">click here</a>.  ', 'http://www.mycollegelocator.com/wp-content/uploads/2013/04/salem1.jpg', 'online', '1', 0),
(3, 'Vista College - Military', '<b>Your Path to a Better Life Starts with Online Training at Home</b>\r\n\r\nEarn Your Online Degree at Vista College Online!\r\n\r\nWe provide online training that leads to diplomas and accredited* Associate of Applied Science (AAS) degrees that can lead to many career opportunities:\r\n<ul>\r\n	<li><b>Business</b> - Our online training program for a Diploma or an Associate Degree Business Administration education provides the real-world experience that employers are looking for.</li>\r\n	<li><b>Healthcare</b> - Our virtual school online offers training programs that prepare you for a rewarding career as a Medical Office Specialist.</li>\r\n	<li><b>Information Technology</b> - An online learning program for a Network Systems Administration degree prepares you for success in any corporation, small company or your own business.</li>\r\n	<li><b>Paralegal</b> - Online learning program for the Associates of Applied Science in Paralegal is designed to prepare students to perform specialized, delegated, substantive legal work for a lawyer, law office, corporation, government agency, or other entity.</li>\r\n</ul>\r\n<i>Financial aid is available for students who qualify, and graduates also benefit from our career services assistance, including resume preparation and interview coaching.</i>\r\n\r\n<b>Take The Next Step Toward a Rewarding Career Right Now!</b>\r\n\r\n<i>*Vista College Online is accredited by the Accrediting Commission of Career Schools and Colleges (ACCSC).</i>\r\n\r\nVista College is recognized as being a military friendly college through the Servicemembers Opportunities Colleges (SOC).\r\n\r\n<i><b>Degree Completion</b> - The time it takes to complete an associate\\\\\\''s degree at Vista College can vary depending on the number of credits accepted for transfer. Students that have prior college credits are encouraged to submit their transcripts for review. Once enrolled in an associate program, a Vista College Student Advisor will work with you to determine how many credits will transfer and your anticipated graduation date. </i>\r\n\r\nFor required program disclosure information, please visit <a href=\\"#\\">www.vistacollege.edu/info</a>', 'http://www.mycollegelocator.com/wp-content/uploads/2013/04/search_VistaMil.gif', 'online', '1', 0),
(4, 'Brookline College Online', '<b>Accelerate your path to a Nursing career at Brookline College.</b><br><br>\r\nTurn your passion for helping people into a meaningful career with Brookline College\\''s Nursing program. This is your opportunity to prepare for nursing positions in a variety of clinical settings. Get ready for your nursing career quicker with accelerated programs that allow you to go from learning to earning in less time than you may think!\r\n<br><br>\r\nChoose from two bachelor programs:\r\n<ul>\r\n<li>Bachelor of Science in Nursing</li>\r\n<li>Bachelor of Science in Nursing for Baccalaureate Degree Graduates*</li>\r\n</ul>\r\nIf you\\''re already a nurse, continue your education with Brookline\\''s <b>Master of Science in Nursing Education</b>** degree, and prepare to become a nurse educator.<br><br>\r\nBrookline offers you two major benefits:\r\n<br><br><b>Fast </b>- accelerated programs that allow you to go from learning to earning in less time than you may think.\r\n<br><br><b>Supportive</b> - we\\''re here for you, through graduation and beyond. <br><br>\r\nTo get started, simply fill out the form. At Brookline College, we\\''re here to help, so you can be there to help. \r\n<br><br>\r\n<i>*Bachelor’s degree required. This program allows students with a Bachelor\\''s degree in any field to complete their BSN through an accelerated program.<br><br>\r\n**RN license and BSN required.\r\n<br><br>\r\nBrookline College’s Online, Phoenix, Tucson, Tempe and Albuquerque campuses are accredited by the Accrediting Council for Independent Colleges and Schools (ACICS). The Brookline College Bachelor of Science in Nursing for Baccalaureate Degree Graduates nursing education program is a candidate for accreditation by the National League for Nursing Accrediting Commission (3343 Peachtree Road NE, Suite 850, Atlanta, Georgia 30326). Candidacy status does not guarantee that this program will achieve full accreditation, which is granted by the Commission after a full accreditation review including a visit by a team of trained site visitors. Once a program has been granted Candidacy it must seek full accreditation within 2 years.\r\n<br><br>\r\nFor more information about our graduation rates, the median debt of students who completed the program, and other consumer important information, please visit the \\"Reporting and Disclosure\\" tab on our website at <a title=\\"Brookline  Program Disclosures\\" data-lyte-options=\\"width:950 height:600 scrollbars:yes\\" class=\\"lytebox\\" href=\\"http://brooklinecollege.edu/discl/\\">http://brooklinecollege.edu/discl/</a>.</i>\r\n', 'http://www.mycollegelocator.com/wp-content/uploads/2013/04/brookline1.jpg', 'online', '1', 0),
