(10, 'Everest University Online', 'Everest University Online, a Division of Everest University makes career-training convenient and accessible. With courses tailored for working students and others who need a more flexible class...', 'http://www.mycollegelocator.com/wp-content/uploads/2013/04/euonline.jpg', 'online', '1', 0),
(11, 'The Art Institute Online', 'The Art Institute of Pittsburgh - Online Division is the leader in online creative arts education. Offering 16 academic online degree programs, we\\''re here to help you get the education you need to launch or enhance your creative career. The Art Institute of Pittsburgh - Online Division is a part of The Art Institutes system of schools, with more than 40 locations throughout North America. Founded in 1921, The Art Institute of Pittsburgh supports our online degree programs with more than 85 years of excellence.\r\n', 'http://www.mycollegelocator.com/wp-content/uploads/2013/04/arti.gif', 'online', '1', 0),
(12, 'Westwood College Online', 'Westwood custom description goes here ', '', 'online', '1', 0),
(13, 'Kaplan University', 'An online education with Kaplan University will give you the tools you need to change your future. Our helpful instructors are dedicated to helping you succeed—and you have 24/7 access to our friendly', 'http://www.mycollegelocator.com/wp-content/uploads/2013/04/search_kaplan.gif', 'online', '1', 0),
(14, 'Miller-Motte College Online', 'Earn a Degree with Miller-Motte College Online Request Information Today!\r\n\r\nEnroll in an online degree program at Miller-Motte College Online, a premiere online career school', 'http://www.mycollegelocator.com/wp-content/uploads/2013/04/miller3.jpg', 'online', '1', 0),
(15, 'Ellis University', 'Ellis University 	Ellis University\r\nEllis University offers over 50 different accredited online degrees, certificates and specializations within two online schools. At Ellis University, coursework is based on real-world scenarios', 'http://www.mycollegelocator.com/wp-content/uploads/2013/04/EllisU2.jpg', 'online', '1', 0),
