(20, 'Laurus College', '<b>Build the Foundation of Your Future with Laurus College</b><br><br>\r\nOur mission is to provide every student with a quality education and a quality experience in order to prepare them for today\\''s marketplace. To do this we strive to provide focused instruction as well as develop in-demand, marketable skills for every student. Our emphasis on career opportunities in all program offerings helps open up avenues of opportunity that previously may have gone unrealized. Our students gain the fundamental skills you may need in fields such as 3D Animation, Business, Computer Networking, Information Technology, Medical Billing, and Web Design. \r\n<br><br>\r\n<b>3D Animation</b>\r\n<br><br>\r\nGain valuable skills in the video game design, television, and movie development industry. You\\''ll learn to work in both 2D and 3D animation environments while working with the industry\\''s major development software, Maya. Maya will be used for modeling, developing textures and animations. \r\n<br><br>\r\n<b>Computer Networking</b>\r\n<br><br>\r\nKeep computer networks up and running by learning how to maintain and upgrade computer networks for all different size organizations. At Laurus College, we teach networking theory as well as skills that will help you use network management software and understand hardware, advanced implementation and maintenance and familiarize you with network and security protection.\r\n<br><br>\r\n<b>Information Technology &amp; Service Professional</b>\r\n<br><br>\r\nThis program will help you prepare and study for an A+ Certification and develop computer servicing skills. You\\''ll also gain familiarity with computer hardware and component installation, work with various OS and communication platforms and learn techniques for troubleshooting. \r\n<br><br>\r\n<b>Medical Billing</b>\r\n<br><br>\r\nLaurus College can help you work towards a career in the medical billing field. You\\''ll learn different medical terminology, steps to analyzing forms and study diagnosis, supplies and procedural coding. \r\n<br><br>\r\n<b>Office Support</b>\r\n<br><br>\r\nMany organizations need qualified office support, and without those people in place productivity of those organizations could suffer. At Laurus, you can gain computer and administrative skills for use in today\\''s office environment. You\\''ll develop skills in word processing, business communications, spreadsheet usage and creating Microsoft PowerPoint presentations. \r\n<br><br>\r\n<b>Professional Business Systems</b>\r\n<br><br>\r\nThis certificate will you help you develop fundamental skills in business administration, accounting, business start-up and marketing. You\\''ll learn a wide range of Microsoft Office software, basic accounting and marketing principles &amp; techniques and gain an understanding of project management strategies.\r\n<br><br>\r\n<b>Web Design</b>\r\n<br><br>\r\nAs the way people use the internet continues to change web designers and developers will be needed. Laurus College can help you develop practical skills for this exciting field. You\\''ll train on software and programs that are widely used in the industry. Other items covered are: exploring web page planning and production strategies as well as creating and editing web pages. \r\n<br><br>\r\n<b><u>Disclaimers:</u></b><br>\r\nFor Student Consumer Disclosures please visit: \r\n<a title=\\"Laurus College  Disclosures\\" data-lyte-options=\\"width:950 height:600 scrollbars:yes\\" class=\\"lytebox\\" href=\\"http://lauruscollege.edu/dl/Laurus_College_Student_Consumer_Information.pdf\\">click here</a>\r\n<br><br>\r\nLaurus College is accredited by the Accrediting Council for Independent Colleges and Schools (ACICS)', '', 'online', '1', 0),
(21, 'Northcentral University', 'Northcentral University was founded with the goal of providing accessible, high-quality, online graduate degrees to working professionals.  NCU currently serves students worldwide, focusing on Doctoral and Masterï¿½s degrees in the Schools of Business and Technology Management, Education, and Behavioral and Health Sciences.  Providing unprecedented access to regionally accredited online graduate degree programs utilizing a One-to-One faculty-mentored approach to online learning with highly-credentialed faculty, Northcentral University is an excellent choice for adult students who share a passion for excellence in higher education.\r\n<br><br>\r\n<b>MISSION </b><br>\r\nNorthcentral University educates professionals throughout the world and provides an accessible opportunity to earn a U.S. regionally accredited degree. Northcentral mentors students One-to-One with highly credentialed faculty via advanced delivery modalities.  Northcentral commits to helping students achieve academically and become valuable contributors to their communities and within their professions.\r\n<br><br>\r\n<b>VISION</b><br>\r\nNorthcentral University is a premier online graduate university and a global leader in providing unprecedented access to U.S. regionally accredited higher education.\r\n<br><br>\r\n<b>VALUES <br> \r\nI.D.E.A.\\''s Founded on INTEGRITY</b><br>\r\nWe hold all members of our community to the highest ethical standards of professional and academic conduct and the rules and regulations of U.S. higher education.\r\n<br><ul>\r\n<li><b>Innovation:</b> We envision new and innovative education delivery systems, and support proven concepts of teaching and learning.  We encourage our community to seek solutions to educational challenges that will improve the quality of our programs and services.</li>\r\n<br>\r\n<li><b>Diversity:</b> We value diversity of thought and action as a strength that allows our community to transcend organizational and geographical boundaries. We expect members of our community to treat people with respect and dignity.</li>\r\n<br>\r\n<li><b>Excellence:</b> Our community is committed to excellence in academics and service. We value leadership and strive for continuous improvement in everything we do.  We define and measure outcomes and take action to ensure that our communityï¿½s passion for excellence is never compromised.</li>\r\n<br>\r\n<li><b>Accountability:</b>  We are deeply committed to holding each member of the University responsible for their scholarly and professional work. We expect financial responsibility in the actions of our students and University team.</li>\r\n</ul>\r\n<b>WHY NORTHCENTRAL?</b>\r\n<ul><li>Regionally accredited</li>\r\n<li>One-to-One faculty mentored approach</li>\r\n<li>No physical residency requirements</li>\r\n<li>Highly credentialed faculty</li>\r\n<li>Applied experiential learning</li>\r\n<li>Weekly course starts</li>\r\n</ul>\r\n<b>ACCREDITATION</b><br>\r\nNorthcentral University is accredited by the Higher Learning Commission (HLC) and is a member of the North Central Association of Colleges and Schools (NCA) (230 South LaSalle Street, Suite 7-500, Chicago, IL 60604, 1.800.621.7440,  <a href=\\"http://www.ncahlc.org\\">www.ncahlc.org)</a>. In addition to regional accreditation from the Higher Learning Commission (HLC), NCUï¿½s degree programs in the School of Business and Technology Management are accredited by the Accreditation Council for Business Schools and Programs (ACBSP).  NCU was the first accredited online university to feature an ACBSP accredited business school.\r\n<p>Northcentral University strives to enable students to make informed choices about their academic program selection by making disclosures to prospective students in a clear, timely, and meaningful way. Visit <a href=\\"http://www.ncu.edu/GE\\">www.ncu.edu/GE</a> for more information.</p>', 'http://www.mycollegelocator.com/wp-content/uploads/2013/04/search_Northcentral.gif', 'online', '1', 0);
